    def reset(self):
        self.question_popup(text='Resetting Machine', action=self._popup_button)

    def reset_value(self):
        vna = hp.HP8753E()
        self.mode_selector.setCurrentText('SING')
        vna.set_mode('SING')
        self.meas_selector.setCurrentText('B')
        vna.set_MEAS(net='B')
        self.chan_selector.setCurrentText('S21')
        vna.set_chan(chan='S21')
        self.DDF_selector.setCurrentText('LOGM')
        vna.set_displayed_data_format('LOGM')
        self.DOF_selector.setCurrentText('OUTPFORM')
        vna.data_outp_fmt('OUTPFORM')
        self.FMT_selector.setCurrentText('FORM2')
        vna.set_format('FORM2')

    def info_popup(self, text):
        msg = QtWidgets.QMessageBox()
        msg.setIcon(QtWidgets.QMessageBox.Information)
        msg.setWindowTitle('Infos')
        msg.setText(text)
        msg.exec_()
    
    def critical_popup(self, text):
        msg = QtWidgets.QMessageBox()
        msg.setIcon(QtWidgets.QMessageBox.Critical)
        msg.setWindowTitle('Critical!')
        msg.setText(text)
        msg.exec_()

    def warning_popup(self, text):
        msg = QtWidgets.QMessageBox()
        msg.setIcon(QtWidgets.QMessageBox.Warning)
        msg.setWindowTitle('Warning')
        msg.setText(text)
        msg.exec_()

    def question_popup(self, text, action):
        msg = QtWidgets.QMessageBox()
        msg.setIcon(QtWidgets.QMessageBox.Question)
        msg.setWindowTitle('Question')
        msg.setText(text)
        msg.setStandardButtons(QMessageBox.Yes | QMessageBox.No)
        msg.setDefaultButton(QMessageBox.No)
        msg.buttonClicked.connect(action)
        msg.exec_()

    def reset_popup_button(self, i):
        vna = hp.HP8753E()
        if i.text() == 'Yes':
            vna.reset()

    def communicate(self):
        vna = hp.HP8753E()
        check, text = vna.check_status()
        if check==1:
            self.warning_popup('Error Detected!'+str(text))
            raise Exception(text)
        else:
            text = 'Communicating with HP8753E VNA correctly'
            self.info_popup(text)
            print(text)
        return vna

    def combobox_write(self, _): # We receive the index, but don't use it.
        vna = hp.HP8753E()
        ctext = self.mode_selector.currentText()
        vna._vna.write(str(ctext))

    def doAction(self): 
  
        # setting for loop to set value of progress bar 
        for i in range(101): 
            # setting value to progress bar 
            self.progressBar.setValue(i)
